import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products Page!</h1>
      <ul>
        <li>
          <Link to="/product-details/p1">Product 1</Link>
        </li>
        <li>
          <Link to="/products-details/p2">Product 2</Link>
        </li>
        <li>
          <Link to="/products-details/p3">Product 3</Link>
        </li>
        <li>
          <Link to="/products/p4">Product 4</Link>
        </li>
      </ul>
    </section>
  );
};

export default Products;
